  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.scss']
})
export class HomeComponent {
  //create user object
  user = {

  constructor(public UserService: GetUserInfoService) {
    this.UserService.GetAllInfo().subscribe((data) => {
      console.log(data);
    });
  }
}
